        <div className="main-container">
            <img src={logo} alt="Tindev"/>
            <ul>
                <li>
                    <img src="https://avatars2.githubusercontent.com/u/20958720?v=4" alt=""/>
                    <footer>
                        <strong>Vinicios Henriques</strong>
                        <p>Estudante de An√°lise e Desenvolvimento de Sistema na Ulbra-Torres/RS</p>
                    </footer>
                </li>
            </ul>
        </div>
        
    );
};
